          <StatContainerBox statName="Total Patients" statValue="20" />
          <StatContainerBox statName="Total Patients" statValue="20" />
          <StatContainerBox statName="Total Patients" statValue="20" />
        </div>
      </div>
    </div>
  );
}

export default mainPage;
